import React from 'react';
import { useSelector } from 'react-redux';

const UserInfo = () => {
  const { email, profile, resume, repositories } = useSelector((state) => state.userPortfolio.data);

  const languages = resume?.languages?.map(lang => `${lang.language} (${lang.proficiency})`).join(', ') ?? 'Languages not available';
  const fullName = profile?.fullName ?? 'Name not available';
  const bio = profile?.bio ?? 'Bio not available';
  const roleTitle = profile?.roleTitle ?? 'Role not specified';

  return (
    <div className="container my-4">
      {/* Personal Information */}
      <div className="row mb-4">
        <div className="col">
          <h2>{fullName}</h2>
          <p>{roleTitle}</p>
          <p>{bio}</p>
          <p><strong>Email:</strong> {email}</p>
          <p><strong>Phone:</strong> {profile?.phone}</p>
          <p><strong>Location:</strong> {profile?.location}</p>
          <p><strong>Languages:</strong> {languages}</p>
        </div>
      </div>

      {/* Skills */}
      <div className="row mb-4">
        <div className="col">
          <h3>Skills</h3>
          <ul>
            {resume?.skills?.map(skill => <li key={skill._id}>{skill.name}</li>)}
          </ul>
        </div>
      </div>

      {/* Work Experience */}
      <div className="row mb-4">
        <div className="col">
          <h3>Work Experience</h3>
          {resume?.workExperience?.map(exp => (
            <div key={exp._id}>
              <h4>{exp.title} - {exp.company}</h4>
              <p>{exp.description}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Education */}
      <div className="row mb-4">
        <div className="col">
          <h3>Education</h3>
          {resume?.education?.map(edu => (
            <div key={edu._id}>
              <h4>{edu.institution}</h4>
              <p>{edu.degree}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Projects */}
      <div className="row">
        <div className="col">
          <h3>Projects</h3>
          {resume?.projects?.map(project => (
            <div key={project._id}>
              <h4>{project.title}</h4>
              <p>{project.description}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Repositories */}
      <div className="row">
        <div className="col">
          <h3>Repositories</h3>
          <ul>
            {repositories?.map(repo => <li key={repo._id}>{repo.repoUrl}</li>)}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default UserInfo;
